    for (fk, fv) in favorite_counts.items():
        result += dp[fv][card_counts[fk]]
    return result

def calculate_max_joy_levels(n, k, cards, favorites, joy_levels):
    from collections import Counter
    joy_levels.insert(0, 0)
    card_counts = Counter(cards)
    favorite_counts = Counter(favorites)
    dp = [[0] * (n * k + 1) for _ in range(n + 1)]
    for ni in range(1, n + 1):
        for ki in range(1, n * k + 1):
            mficount = min(k, ki) + 1
            for kii in range(mficount):
                dp[ni][ki] = max(dp[ni][ki], dp[ni - -1][ki - kii] + joy_levels[kii])
    result = 0
    for (fk, fv) in favorite_counts.items():
        result += dp[fv][card_counts[fk]]
    return result
